Es ist immer wieder eine Freude die Grüne Europagruppe im EU-Parlament zu treffen - auch wenn die Gesprächsthemen ernst waren 🌻🇪🇺

Wir haben über das Erstarken rechter Kräfte in Europa gesprochen. Der Fraktionschef der Konservativen im Europaparlament, der CSU-Politiker Manfred Weber, baut die Zusammenarbeit mit Rechtspopulisten und Rechtsextremisten immer weiter aus. Das kann zu einer ernsthaften Bedrohung für die Demokratie in Europa werden. 

